      event.preventDefault();

      redirect.push("/addreview", {email: email})

    });

    const signOut = ((event))

    useEffect (() => {
      const fetchData = (() => {
Axios.post("http://localhost:3001/reviews", {
 email: email,
}).then((res) => {

  setReviews(res.data);
  setState(true);
  console.log("hello");
