      </div>
    ); 


if(!state){
  return (
    <div>
      <h1>Welcome {email}!</h1>
      <div>Loading...</div>
    </div>
  );

} else if (reviews.data.length == 0){
return (
  <div>
    <h1>Welcome {email}!</h1>
    <button onClick={onClick}>Add book review</button>

    <div>No reviews</div>
  </div>
);
} else {
      return (
        <div>
          <h1>Welcome {email}!</h1>
          <button onClick={onClick}>Add book review</button>

        {reviews.data.map((review) => {
          return(
            <ul>
              <li>{review.title}</li>
              </ul>
          );
        })}
        </div>
      );
          }   
   }




export default Profile;
